import React from "react";

const BreweryCard = ({ brewery }) => {
  return (
    <div className="card">
      <h2>{brewery.name}</h2>
      <h3>{brewery.brewery_type}</h3>
      <p>{brewery.street}</p>
      <p>{brewery.city}</p>
      <p>{brewery.state}</p>
      <p>{brewery.phone}</p>
      <a href={brewery.website_url}>{brewery.website_url}</a>
    </div>
  );
};

export default BreweryCard;
